// src/modules/Recruiter/RecruiterRouting.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import RecruiterModule from './RecruiterModule';

const RecruiterRouting = () => {
  return (
    <Router>
      <Routes>
        <Route path="recruiter/*" element={<RecruiterModule />} />
      </Routes>
    </Router>
  );
};

export default RecruiterRouting;
